import { Center, Text, VStack, Heading, Box , Button, ButtonGroup  } from '@chakra-ui/react';
function MyButton() {
    return (
        <Center mt="250px">
            <Vstack spacing={4} direction='row' align='center'>
                <Button colorScheme='teal' size='lg'>
                    ADMIN
                </Button>
            </Vstack>
        </Center>

    );
}
const Home = (): JSX.Element => (
<div style={{ backgroundColor: "blue", height: "78.6vh" }}>
    <Center mt="160px">
     <VStack spacing="32px">
          <Heading>Find Your BEER</Heading>
          <Text fontSize='4xl'>Find the beer that suits you</Text>
          <MyButton />
     </VStack>
    </Center>
</div>
);
export default Home;
